    public void NavigateBack()
    {
        fileHashLink = "";
        for (int i = 0; i < 10; i++)
        {
            string P = FSService.ParentDir(Path);
            if (usr.Validate(P, FSPermission.Read))
            {
                NavigateAbs(P);
                return;
            }
        }
        NavigateHome();

    }
    public void NavigateHome()
    {
        fileHashLink = "";
        NavigateAbs("-/");
    }

